import React from 'react'

const KeyInfo = () => {
    useEffect(() => {
        if (sessionStorage.getItem("users") != null) {
          const loguser = sessionStorage.getItem("users");
          const username = JSON.parse(loguser);
          setusname(username.uname);
          setislog(true);
        }
        axios
          .post(process.env.REACT_APP_BACKEND + "/getKe", { usname })
          .then((res) => {
            setkeydata(res.data.Key);
            setiskey(true);
          });
        }, []);
  return (
    <>
            <h3 className="text-center mt-5 shadow-lg p-2">KEY DETAILS</h3>
      <div className="card mt-5 PT-3 form-control">
        <div className="card-body mt-3">
            <h6>Application Name</h6>
        </div>
        </div>
    </>
  )
}

export default KeyInfo
